import React, { Component } from 'react';
import './section1.css';
import image from "../assets/images/GGR28449.jpg";

class Section1 extends Component {
  render() {
    console.log(this.props.data);
    return (
        <div className ="Section1">
            <div className="img">
                <img src={image}></img>
            </div>
            <h2>PERFIL</h2>
            <hr></hr>
            <label>{this.props.data.bio.description}</label>

            <h2>Contacto</h2>
            <hr></hr>
            <label>{this.props.data.personal_information.phone}</label>
            <label>{this.props.data.personal_information.mail}</label>
            <label>{this.props.data.personal_information.direction}</label>

            <h2>Habilidades</h2>
            <hr></hr>
            <label>{this.props.data.bio.description}</label>

            <h2>Idiomas</h2>
            <hr></hr>
            <label>{this.props.data.bio.description}</label>
        </div>
    )
  }
}

export default Section1
